import {Link} from 'react-router-dom';

import "./App.css"

export default class logo extends Component {
    render() {
        let lik = <a href="/">Início</a>
        let link = <a href="/Pokemons">Pokedex</a>
        let like = <a href="/">Notícia</a>
        let lke = <a href="/">Contato</a>


        return (
            <div><nav className="navbar">


            <nav className="title">
              <img src="https://img.icons8.com/carbon-copy/100/000000/news.png" height="150px"  style={{margin:"-16px"}}/>              
            </nav> 
             <div className="menu">
          <ul className="letra">
              <li className="home">
                  {lik}
                  </li>
                  <li className="Pokedex">
                  {link}
                  </li>
                      <li className="Noticia">
                      {like} 
                  </li>
                      <li className="Notacao">
                      {lke} 
                      </li>
                      </ul>

</div>   
        </nav>

      </div>

  )
}
}
